import React, { Component } from 'react';
import './App.css';
import NaviMenu from './NaviMenu';
import gitathonLogo from './img/gitathonLogo.png'
import hackathonLogo from './img/hackathonLogo.png'
import profileLogo from './img/profileLogo.png'


class App extends Component {
  render() {
    return (
      <div className="App">
        <NaviMenu
          gitathonLogo={gitathonLogo}
          userName={"장예솔"}
          hackathonLogo = {hackathonLogo}
          profileLogo={profileLogo}
        />
      </div>
    );
  }
}

export default App;
